import React from 'react';

const Home = () => {
  return (
    <div>
      <h1>Hello World!</h1>
      <p>This is a paragraph of text.</p>
      <ul>
        <li>Item 1</li>
        <li>Item 2</li>
        <li>Item 3</li>
      </ul>
    </div>
  );
};

export default Home;
